/*
 * This is the primary high-level API for the project. In this folder there should be:
 * A class called InsightFacade, this should be in a file called InsightFacade.ts.
 * You should not change this interface at all or the test suite will not work.
 */

export enum InsightDatasetKind {
	Sections = "sections",
	Rooms = "rooms",
}

export interface InsightDataset {
	id: string;
	kind: InsightDatasetKind;
	numRows: number;
}

export interface InsightResult {
	[key: string]: string | number;
}

export class InsightError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, InsightError);
	}
}

export class NotFoundError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, NotFoundError);
	}
}

export class ResultTooLargeError extends Error {
	constructor(message?: string) {
		super(message);
		Error.captureStackTrace(this, ResultTooLargeError);
	}
}

export interface IInsightFacade {
	/**
	 * Add a dataset to insightUBC.
	 *
	 * @param id  The id of the dataset being added. Follows the format /^[^_]+$/
	 * @param content  The base64 content of the dataset. This content should be in the form of a serialized zip file.
	 * @param kind  The kind of the dataset
	 *
	 * @return Promise <string[]>
	 *
	 * The promise should fulfill on a successful add, reject for any failures.
	 * The promise should fulfill with a string array,
	 * containing the ids of all currently added datasets upon a successful add.
	 * The promise should reject with an InsightError describing the error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 * If id is the same as the id of an already added dataset, the dataset should be rejected and not saved.
	 *
	 * After receiving the dataset, it should be processed into a data structure of
	 * your design. The processed data structure should be persisted to disk; your
	 * system should be able to load this persisted value into memory for answering
	 * queries.
	 *
	 * Ultimately, a dataset must be added or loaded from disk before queries can
	 * be successfully answered.
	 */
	addDataset(id: string, content: string, kind: InsightDatasetKind): Promise<string[]>;

	/**
	 * Remove a dataset from insightUBC.
	 *
	 * @param id  The id of the dataset to remove. Follows the format /^[^_]+$/
	 *
	 * @return Promise <string>
	 *
	 * The promise should fulfill upon a successful removal, reject on any error.
	 * Attempting to remove a dataset that hasn't been added yet counts as an error.
	 *
	 * An id is invalid if it contains an underscore, or is only whitespace characters.
	 *
	 * The promise should fulfill the id of the dataset that was removed.
	 * The promise should reject with a NotFoundError (if a valid id was not yet added)
	 * or an InsightError (invalid id or any other source of failure) describing the error.
	 *
	 * This will delete both disk and memory caches for the dataset for the id meaning
	 * that subsequent queries for that id should fail unless a new addDataset happens first.
	 */
	removeDataset(id: string): Promise<string>;

	/**
	 * Perform a query on insightUBC.
	 *
	 * @param query  The query to be performed.
	 *
	 * If a query is incorrectly formatted, references a dataset not added (in memory or on disk),
	 * or references multiple datasets, it should be rejected.
	 *
	 * @return Promise <InsightResult[]>
	 *
	 * The promise should fulfill with an array of results.
	 * The promise should reject with a ResultTooLargeError (if the query returns too many results)
	 * or an InsightError (for any other source of failure) describing the error.
	 */
	performQuery(query: unknown): Promise<InsightResult[]>;

	/**
	 * List all currently added datasets, their types, and number of rows.
	 *
	 * @return Promise <InsightDataset[]>
	 * The promise should fulfill an array of currently added InsightDatasets, and will only fulfill.
	 */
	listDatasets(): Promise<InsightDataset[]>;
}

import {
	IInsightFacade,
	InsightDataset,
	InsightDatasetKind,
	InsightError,
	InsightResult,
	NotFoundError,
	ResultTooLargeError,
} from "./IInsightFacade";
import ValidateQuery from "../services/validateQuery";
import CollectQuery from "../services/collectQuery";
import ValidateDataset from "../services/validateDataset";
import {DatasetEntry} from "../serviceHelpers/datasetConstruction/DatasetEntry";
import DatasetManager from "../services/DatasetManager";
import SectionsDatasetEntry from "../serviceHelpers/datasetConstruction/sectionsDataset/SectionsDatasetEntry";

export default class InsightFacade implements IInsightFacade {
	private datasetManager: DatasetManager = new DatasetManager();

	public async addDataset(id: string, content: string, kind: InsightDatasetKind): Promise<string[]> {
		/*
			The promise should fulfill on a successful add, reject for any failures.
			The promise should fulfill with a string array,
			containing the ids of all currently added datasets upon a successful add.
			The promise should reject with an InsightError describing the error.

			An id is invalid if it contains an underscore, or is only whitespace characters.
			If id is the same as the id of an already added dataset, the dataset should be rejected and not saved.

			After receiving the dataset, it should be processed into a data structure of
			your design. The processed data structure should be persisted to disk; your
			system should be able to load this persisted value into memory for answering
			queries.

			Ultimately, a dataset must be added or loaded from disk before queries can
			be successfully answered.
		 */
		const validator = new ValidateDataset();
		let dataset: DatasetEntry | undefined;
		let datasetIds = await this.datasetManager.getDatasetIds();
		if (validator.validateId(id, datasetIds)) {
			let valid = await validator.validateContent(id, content, kind);
			if (valid) {
				dataset = validator.getValidDataset();
				if (dataset) {
					await this.datasetManager.saveDataset(dataset);
				}
				let result = await this.datasetManager.getDatasetIds();
				return Promise.resolve(result);
			} else {
				return Promise.reject(new InsightError("Invalid content."));
			}
		} else {
			return Promise.reject(new InsightError("Invalid id."));
		}
	}

	public async performQuery(query: unknown): Promise<InsightResult[]> {
		let datasets: DatasetEntry[] = await this.datasetManager.loadDatasetFromDisk();
		let isValid: boolean = false;
		let validate = new ValidateQuery(query as typeof Object);
		let collect = new CollectQuery(query as typeof Object, datasets);

		let results: InsightResult[] = [];
		try {

			let prelimDatasetId = validate.getPreliminaryDatasetId();
			let datasetKind: InsightDatasetKind | undefined;
			for (let dataset of datasets) {
				if (dataset.getId() === prelimDatasetId) {
					datasetKind = dataset.getKind();
				}
			}
			if (datasetKind !== undefined) {
				isValid = validate.ValidateQuery(datasetKind);
			} else {
				isValid = false;
			}
			if (validate.getDatasetId() !== validate.getPreliminaryDatasetId()) {
				isValid = false;
			}

			if (!isValid) {
				throw new InsightError("Invalid Query");
			}
			if (datasetKind !== undefined) {
				results = await collect.CollectQuery(validate.getDatasetId(), datasetKind);
			}
		} catch (e) {
			if (e instanceof InsightError) {
				throw e;
			} else if (e instanceof ResultTooLargeError) {
				throw e;
			} else {
				throw new InsightError(String(e instanceof Error));
			}
		}

		return Promise.resolve(results);
	}

	public async listDatasets(): Promise<InsightDataset[]> {
		const result = await this.datasetManager.readDatasetLedger();
		return Promise.resolve(result);
	}

	public async removeDataset(id: string): Promise<string> {
		try {
			let result = await this.datasetManager.removeDataset(id);
			return Promise.resolve(result);
		} catch {
			return Promise.reject(new NotFoundError("RemoveDataset failed."));
		}
	}
}

import {InsightDatasetKind, InsightError} from "../controller/IInsightFacade";
import {
	checkMfieldsBasedOnKind,
	checkSfieldsBasedOnKind,
	validateIdString
} from "../serviceHelpers/helpers/collectionHelpers";
import ValidateTransformations from "../serviceHelpers/queryEngine/validators/validateTransformations";
import ValidateOptions from "../serviceHelpers/queryEngine/validators/validateOptions";

// Use sections kind instead of dataset id
//
//
//
export default class ValidateQuery {
	private query: object;
	private datasetId: string = "";
	private expectedKeys = ["WHERE", "OPTIONS", "TRANSFORMATIONS"];

	private allowedColumns: string[] = [];

	constructor(query: object) {
		this.query = query;
	}

	public ValidateQuery(datasetKind: InsightDatasetKind): boolean {
		let hasTransformations: boolean = false;
		let isValid = false;
		let keys: string[];

		keys = Object.keys(this.query);

		isValid = keys.every((key)=> this.expectedKeys.includes(key));
		if (!isValid) {
			return isValid;
		}

		if (keys.includes("TRANSFORMATIONS")) { // need to add allowedColumns
			// check transformations
			let validateTransformations =
				new ValidateTransformations(this.query["TRANSFORMATIONS" as keyof typeof this.query], datasetKind);
			isValid = validateTransformations.Validate();

			if (!isValid) {
				return isValid;
			}

			this.setAllowedColumns(validateTransformations.getAllowedColumns());
			this.setDatasetId(validateTransformations.getDatasetId());
			hasTransformations = true;
		}

		// console.log("Valid Transform");

		// check options
		let validateOptions = new ValidateOptions(this.query["OPTIONS" as keyof typeof this.query],
			hasTransformations, datasetKind, this.getAllowedColumns(), this.getDatasetId());
		isValid = validateOptions.Validate();
		if (!isValid) {
			return isValid;
		}
		this.setDatasetId(validateOptions.getDatasetId());

		// console.log("Valid Options");

		// check where
		isValid = this.validateBody(this.query["WHERE" as keyof typeof this.query], datasetKind, this.getDatasetId());
		if (!isValid) {
			return isValid;
		}

		// console.log("Valid Body");

		return isValid;
	}

	private validateBody(body: object, datasetKind: InsightDatasetKind, datasetId: string): boolean {
		let isValid = true;
		let keys: string[];
		keys = Object.keys(body);
		// console.log("Body", keys);

		for (let key of keys) {
			if (key === "GT" || key === "LT" || key === "EQ") { // MCOMP
				isValid = this.validateMCOMP(body[key as keyof typeof body], datasetKind, datasetId);
				if (!isValid) {
					return isValid;
				}
			} else if (key === "AND" || key === "OR") { // LOGICCOMP
				isValid = this.validateLOGICCOMP(body[key as keyof typeof body], datasetKind,datasetId);
				if (!isValid) {
					return isValid;
				}
			} else if (key === "IS") { // SCOMP
				isValid = this.validateSCOMP(body[key as keyof typeof body], datasetKind,datasetId);
				if (!isValid) {
					return isValid;
				}
			} else if (key === "NOT") { // NEGATION
				isValid = this.validateNEGATION(body[key as keyof typeof body], datasetKind,datasetId);
				if (!isValid) {
					return isValid;
				}
			} else {
				throw new InsightError("Invalid Query");
			}
		}

		return isValid;
	}

	private validateMCOMP(mcomp: object, datasetKind: InsightDatasetKind, datasetId: string): boolean {
		let isValid = false;
		let keys: string[];
		keys = Object.keys(mcomp);
		// console.log("MCOMP", keys);


		for (let key of keys) {
			let mkey = key.split("_");

			if (mkey.length !== 2) {
				throw new InsightError("Invalid Query");
			}
			let isValidString = mkey[0] === String(datasetId);
			if (!isValidString || !checkMfieldsBasedOnKind(datasetKind, mkey[1])) {
				throw new InsightError("Invalid Query");
			}

			try {
				const value: number = mcomp[key as keyof typeof mcomp]; // fail if numeric string or array or empty
				if (typeof mcomp[key as keyof typeof mcomp] !== "number") {
					throw new InsightError("Invalid Query");
				}
				// console.log("MCOMP val", value);
				isValid = true;
				if (!isValid) {
					return isValid;
				}
			} catch (e) {
				throw new InsightError("Invalid Query");
			}
		}
		return isValid;
	}

	private validateLOGICCOMP(logiccomp: object, datasetKind: InsightDatasetKind, datasetId: string): boolean {
		let isValid = false;
		let keys: string[];
		keys = Object.keys(logiccomp);

		for (let key of keys) {
			isValid = this.validateBody(logiccomp[key as keyof typeof logiccomp], datasetKind, datasetId);
			if (!isValid) {
				return isValid;
			}
		}

		return isValid;
	}

	private validateSCOMP(scomp: object, datasetKind: InsightDatasetKind, datasetId: string): boolean {
		let isValid = false;
		let keys: string[];
		keys = Object.keys(scomp);
		// console.log("SCOMP", keys);

		for (let key of keys) {
			let skey = key.split("_");
			if (skey.length !== 2) {
				throw new InsightError("Invalid Query");
			}

			let isValidString = skey[0] === String(datasetId); // instead check if matches dataset id
			if (!isValidString || !checkSfieldsBasedOnKind(datasetKind,skey[1])) {
				throw new InsightError("Invalid Query");
			}
			try {
				const value: string = scomp[key as keyof typeof scomp]; // fail if array or empty
				if (typeof scomp[key as keyof typeof scomp] !== "string") {
					throw new InsightError("Invalid Query");
				}
				isValid = this.validateInputString(value);
				if (!isValid) {
					return isValid;
				}
			} catch (e) {
				throw new InsightError("Invalid Query");
			}
		}
		return isValid;
	}

	private validateNEGATION(neg: object, datasetKind: InsightDatasetKind, datasetId: string): boolean  {
		let isValid = false;
		let keys: string[];
		keys = Object.keys(neg);
		// console.log("Negation", keys);

		if (keys.length > 1) {
			throw new InsightError("Invalid Query");
		}
		isValid = this.validateBody(neg, datasetKind, datasetId);

		return isValid;
	}

	private validateInputString(inputString: string): boolean  { // implement
		// const regEx = /^ *$|^([* A-Za-z0-9[^\]][ A-Za-z0-9[^\]]*[* A-Za-z0-9[^\]]|[* A-Za-z0-9[^\]])$/;
		const regEx = /^[*]?[^*]*[*]?$/;
		if (!regEx.test(inputString)) {
			throw new InsightError("Invalid input string");
		}
		return true;
	}

	public getPreliminaryDatasetId(): string {
		let datasetId = "";
		let options: object = this.query["OPTIONS" as keyof typeof this.query];

		datasetId = getDatasetIdFromCols(options);
		function getDatasetIdFromCols(obj: object): string {
			let dtId = "";
			let cols: string[] = obj["COLUMNS" as keyof typeof obj];
			for (let col of cols) {
				let fields = col.split("_");
				if (fields.length === 2) {
					dtId = fields[0];
					break;
				}
			}
			return dtId;
		}
		return datasetId;
	}

	public getDatasetId(): string {
		return this.datasetId;
	}

	private setDatasetId(id: string) {
		this.datasetId = id;
	}

	private getAllowedColumns(): string [] {
		return this.allowedColumns;
	}

	private setAllowedColumns(cols: string[]) {
		this.allowedColumns = cols;
	}
}

import SectionEntry from "../datasetConstruction/sectionsDataset/SectionEntry";
import {Property} from "../../services/collectQuery";
import {InsightDatasetKind, InsightError} from "../../controller/IInsightFacade";
import QueryObject from "../datasetConstruction/QueryObject";

export function collectInsightResult(qObj: QueryObject, resultCols: Set<string>): Property[] {
	let propertiesToAdd: Property[] = [];
	for (let resultCol of resultCols) {
		let keyField = resultCol.split("_")[1];
		if (keyField === "avg") {
			propertiesToAdd.push({key:resultCol, value: Number(qObj.get_avg())});
		} else if (keyField === "pass") {
			propertiesToAdd.push({key:resultCol, value: Number(qObj.get_pass())});
		} else if (keyField === "fail") {
			propertiesToAdd.push({key:resultCol, value: Number(qObj.get_fail())});
		} else if (keyField === "audit") {
			propertiesToAdd.push({key:resultCol, value: Number(qObj.get_audit())});
		} else if (keyField === "year") {
			propertiesToAdd.push({key:resultCol, value: Number(qObj.get_year())});
		} else if (keyField === "lat") {
			propertiesToAdd.push({key:resultCol, value: Number(qObj.getLat())});
		} else if (keyField === "lon") {
			propertiesToAdd.push({key:resultCol, value: Number(qObj.getLon())});
		} else if (keyField === "seats") {
			propertiesToAdd.push({key:resultCol, value: Number(qObj.getSeats())});
		} else if (keyField === "dept") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.get_dept())});
		} else if (keyField === "id") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.get_id())});
		} else if (keyField === "instructor") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.get_instructor())});
		} else if (keyField === "title") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.get_title())});
		} else if (keyField === "uuid") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.get_uuid())});
		}else if (keyField === "fullname") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.getFullname())});
		} else if (keyField === "shortname") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.getShortname())});
		} else if (keyField === "number") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.getNumber())});
		} else if (keyField === "name") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.getName())});
		} else if (keyField === "address") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.getAddress())});
		} else if (keyField === "type") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.getType())});
		} else if (keyField === "furniture") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.getFurniture())});
		} else if (keyField === "href") {
			propertiesToAdd.push({key:resultCol, value: String(qObj.getHref())});
		}
	}
	return propertiesToAdd;
}


export function compare(val: string|number, val2: string|number, dir: string) {

	if (val < val2) {
		return dir === "UP" ? -1 : 1;
		// return -1;
	} else if (val > val2) {
		return dir === "UP" ? 1 : -1;
		// return 1;
	} else {
		return 0;
	}
}


export function convertArrayOfObjectToObject(properties: Property[]): object {
	let result: Record<string, string | number> = {};
	for (let property of properties) {
		result[property.key] = property.value;
	}
	// console.log(result);
	return result;
}

export function checkFieldsBasedOnDatasetKind(datasetKind: InsightDatasetKind, field: string): boolean {
	if (datasetKind === InsightDatasetKind.Sections) {
		let sfieldSections = ["dept", "id", "instructor", "title", "uuid"];
		let mfieldSection = ["avg", "pass", "fail", "audit", "year"];

		if (!sfieldSections.includes(field) && !mfieldSection.includes(field)) {
			return false;
		}

	} else if (datasetKind === InsightDatasetKind.Rooms) {
		let mfieldRooms = ["lat", "lon", "seats"];
		let sfieldRooms = ["fullname", "shortname", "number" , "name" , "address" ,
			"type" , "furniture" , "href"];

		if (!sfieldRooms.includes(field) && !mfieldRooms.includes(field)) {
			return false;
		}

	} else {
		return false;
	}

	return true;
}

export function checkMfieldsBasedOnKind(datasetKind: InsightDatasetKind, mfield: string): boolean {
	if (datasetKind === InsightDatasetKind.Sections) {
		let mfieldSection = ["avg", "pass", "fail", "audit", "year"];

		if (!mfieldSection.includes(mfield)) {
			return false;
		}

	} else if (datasetKind === InsightDatasetKind.Rooms) {
		let mfieldRooms = ["lat", "lon", "seats"];

		if (!mfieldRooms.includes(mfield)) {
			return false;
		}

	} else {
		return false;
	}
	return true;
}

export function checkSfieldsBasedOnKind(datasetKind: InsightDatasetKind, sfield: string): boolean {
	if (datasetKind === InsightDatasetKind.Sections) {
		let sfieldSections = ["dept", "id", "instructor", "title", "uuid"];

		if (!sfieldSections.includes(sfield)) {
			return false;
		}

	} else if (datasetKind === InsightDatasetKind.Rooms) {
		let sfieldRooms = ["fullname", "shortname", "number" , "name" , "address" ,
			"type" , "furniture" , "href"];

		if (!sfieldRooms.includes(sfield)) {
			return false;
		}

	} else {
		return false;
	}

	return true;
}


export function validateIdString(idString: string): boolean {
	// const regEx = /[a-zA-Z0-9[\]^]+/;
	if (idString.length === 0 ) {
		throw new InsightError("Invalid id string");
	}
	if (idString.includes("_")) {
		throw new InsightError("Invalid id string");
	}
	return true;
}

export function transformOrder(properties: Property[][], resultCols: Set<string>): object[] {
	let finalArr: object[] = [];
	// console.log(resultCols);

	if (properties.length === 0) {
		return [{}];
	}
	let keys = Object.keys(properties[0]);
	let keysToDelete: string[] = [];

	for (let key of keys) {
		if (!resultCols.has(properties[0][+key].key)) {
			keysToDelete.push(properties[0][+key].key);
		}
	}
	// console.log(keysToDelete);
	//
	// console.log("KEYS", keys);

	if (keysToDelete.length === 0) {
		for (let property of properties) {
			finalArr.push(convertArrayOfObjectToObject(property));
		}
	} else {
		for (let property of properties) {
			let newProps: Property[] = [];

			for (let p of property) {
				if (!keysToDelete.includes(p.key)) {
					newProps.push(p);
				}
			}
			finalArr.push(convertArrayOfObjectToObject(newProps));
		}
	}
	return finalArr;

}

import {InsightDatasetKind, InsightError} from "../../../controller/IInsightFacade";
import {
	checkFieldsBasedOnDatasetKind,
	checkMfieldsBasedOnKind,
	validateIdString
} from "../../helpers/collectionHelpers";


export default class ValidateTransformations {
	private tf: object;
	private datasetKind: InsightDatasetKind;

	private datasetId: string = "";
	private allowedColumns: string[] = [];
	private APPLYTOKEN_NUMERIC: string[] = ["MAX", "MIN", "AVG", "SUM"];
	private APPLYTOKEN_ALL: string[] = ["COUNT"];


	constructor(tf: object, datasetKind: InsightDatasetKind) {
		this.tf = tf;
		this.datasetKind = datasetKind;
	}

	public Validate(): boolean {
		let isValid = false;
		let hasGroup = false;
		let hasApply = false;
		let keys: string[];
		keys = Object.keys(this.tf); // ['GROUP', 'APPLY']

		for (let key of keys) {
			if (key === "GROUP") { // cannot be empty
				hasGroup = true;
				isValid = this.validateGroup(this.tf[key as keyof typeof this.tf], this.datasetKind);
				if (!isValid) {
					return isValid;
				}
			} else if (key === "APPLY") { // can be empty
				hasApply = true;
				isValid = this.validateApply(this.tf[key as keyof typeof this.tf], this.datasetKind);
				if (!isValid) {
					return isValid;
				}
			} else {
				return false;
			}
		}
		if (!hasApply || !hasGroup) {
			throw new InsightError("Invalid Query");
		}

		return isValid;
	}

	private validateGroup(group: string[], datasetKind: InsightDatasetKind): boolean {
		let isValid = false;

		let datasetIds: string[] = [];

		// keys can repeat
		for (let keyList of group) {
			let datasetId: string = keyList.split("_")[0];
			let field: string = keyList.split("_")[1];

			// each key of keylist in group, check if it has correct sfield or mfield
			// based on sections or rooms as datasetId
			isValid = checkFieldsBasedOnDatasetKind(datasetKind, field);
			if (!isValid) {
				return false;
			}

			this.setAllowedColumns(keyList);
			datasetIds.push(datasetId);
		}
		if (datasetIds.length === 0) {
			return false; // group cannot be empty
		}

		isValid = datasetIds.every((id)=> id === datasetIds[0]);

		if (this.getDatasetId() === "") {
			this.setDatasetId(datasetIds[0]); // if isValid is false, program will error out anyways
		} else {
			if (this.getDatasetId() !== datasetIds[0]) {
				return false;
			}
		}

		return isValid;
	}

	private validateApply(apply: object[], datasetKind: InsightDatasetKind): boolean {
		let applyKey: string = "";

		for (let ap of apply) {
			let keys: string[] = Object.keys(ap);
			if (keys.length > 1) {
				return false;
			}

			applyKey = keys[0];

			// apply key cant be empty or have underscore (same as id string)
			if (!validateIdString(applyKey)) {
				return false;
			}

			if (!this.validateApplyRule(ap[applyKey as keyof typeof ap], datasetKind)) {
				return false;
			}


			// duplicate apply keys not allowed
			if (this.getAllowedColumns().includes(applyKey)) {
				return false;
			} else {
				this.setAllowedColumns(applyKey);
			}
		}

		return true;
	}

	private validateApplyRule(rule: object, datasetKind: InsightDatasetKind): boolean {
		let isValid = false;
		let applyToken = "";

		let keys: string[] = Object.keys(rule);
		if (keys.length > 1) {
			return false;
		}

		applyToken = keys[0];
		// console.log(applyToken); // AVG (applytoken)

		// isValid = this.APPLYTOKEN.includes(applyToken);
		// if (!isValid) {
		// 	return isValid;
		// }

		let col: string = rule[applyToken as keyof typeof rule];

		let colDatasetId: string = col.split("_")[0];
		let colField: string = col.split("_")[1];

		if (this.APPLYTOKEN_NUMERIC.includes(applyToken)) {
			isValid = checkMfieldsBasedOnKind(datasetKind, colField);
			if (!isValid) {
				return isValid;
			}
		} else if (this.APPLYTOKEN_ALL.includes(applyToken)) {
			isValid = checkFieldsBasedOnDatasetKind(datasetKind, colField);
			if (!isValid) {
				return isValid;
			}
		} else {
			return false;
		}


		if (this.getDatasetId() !== "") {
			if (colDatasetId === this.getDatasetId()) {
				isValid = true;
			} else {
				isValid = false;
			}
		} else {
			this.setDatasetId(colDatasetId);
			isValid = true;
		}


		return isValid;
	}

	public getDatasetId(): string {
		return this.datasetId;
	}

	private setDatasetId(id: string) {
		this.datasetId = id;
	}

	public getAllowedColumns(): string [] {
		return this.allowedColumns;
	}

	private setAllowedColumns(col: string) {
		this.allowedColumns.push(col);
	}
}

import {InsightDatasetKind, InsightError} from "../../../controller/IInsightFacade";
import {checkFieldsBasedOnDatasetKind, validateIdString} from "../../helpers/collectionHelpers";

export default class ValidateOptions {
	private options: object;
	private hasTf: boolean;
	private datasetKind: InsightDatasetKind;
	private allowedColumns: string[];
	private datasetId: string = "";
	private requiredColumns: string[] = [];
	constructor(options: object, hasTransformations: boolean, datasetKind: InsightDatasetKind,
		allowedCols: string[], datasetId: string) {
		this.options = options;
		this.hasTf = hasTransformations;
		this.datasetKind = datasetKind;
		this.allowedColumns = allowedCols;
		this.datasetId = datasetId;
	}

	public Validate(): boolean {
		let isValid: boolean = false;
		let keys: string[];
		keys = Object.keys(this.options);

		let validKeys = ["COLUMNS", "ORDER"];
		isValid = keys.every((key) => validKeys.includes(key));
		if (!isValid) {
			return isValid;
		}

		isValid = this.validateOrder(this.options["ORDER" as keyof typeof this.options], this.hasTf, this.datasetKind);
		if (!isValid) {
			return isValid;
		}

		isValid = this.validateColumns(this.options["COLUMNS" as keyof typeof this.options],
			this.hasTf, this.datasetKind);
		if (!isValid) {
			return isValid;
		}

		return isValid;
	}

	private validateOrder(order: object | string, hasTransformations: boolean, datasetKind: InsightDatasetKind) {
		if (order === undefined) {
			return true;
		}

		if (typeof order === "string") {
			if (hasTransformations) {
				if (!this.allowedColumns.includes(order)) {
					return false;
				}
				this.setRequiredColumns(order);
			} else {
				let datasetId = order.split("_")[0];
				let field = order.split("_")[1];

				if (!validateIdString(datasetId) || !checkFieldsBasedOnDatasetKind(datasetKind, field)) {
					return false;
				}
				if (this.getDatasetId() === "") {
					this.setDatasetId(datasetId);
				} else {
					if (this.getDatasetId() !== datasetId) {
						return false;
					}
				}
				this.setRequiredColumns(order);
			}
		} else if (typeof order === "object") {
			// validate sort
			const validKeys = ["dir", "keys"];
			let keys: string[] = Object.keys(order);
			if (!keys.every((key) => validKeys.includes(key))) {
				return false;
			}

			let isValid = this.validateSort(order["dir" as keyof typeof order],
				order["keys" as keyof typeof order], hasTransformations, datasetKind);
			if (!isValid) {
				return false;
			}
		}
		return true;
	}

	private validateSort(dir: string, cols: string[], hasTransformations: boolean, datasetKind: InsightDatasetKind) {
		if (dir !== "UP" && dir !== "DOWN") {
			return false;
		}
		if (hasTransformations) {
			for (let col of cols) {
				if (!this.allowedColumns.includes(col)) {
					return false;
				}
				this.setRequiredColumns(col);
			}
		} else {
			for (let col of cols) {
				let datasetId = col.split("_")[0];
				let field = col.split("_")[1];

				if (!validateIdString(datasetId) || !checkFieldsBasedOnDatasetKind(datasetKind, field)) {
					return false;
				}
				if (this.datasetId === "") {
					this.setDatasetId(datasetId);
				} else {
					if (this.getDatasetId() !== datasetId) {
						return false;
					}
				}
				this.setRequiredColumns(col);
			}
		}
		return true;
	}

	private validateColumns(cols: string[], hasTransformations: boolean, datasetKind: InsightDatasetKind): boolean {
		if (cols.length === 0) {
			return false;
		}

		if (this.getRequiredColumns().length > 0) {
			if (!this.requiredColumns.every((col) => cols.includes(col))) {
				return false;
			}
		}

		for (let col of cols) {
			if (hasTransformations) {
				if (!this.allowedColumns.includes(col)) {
					return false;
				}
			} else {
				let datasetId = col.split("_")[0];
				let field = col.split("_")[1];

				let isValidId = validateIdString(datasetId);

				if (!isValidId || !checkFieldsBasedOnDatasetKind(datasetKind, field)) {
					throw new InsightError("Invalid Query");
				}

				if (this.getDatasetId() !== "") {
					if (this.getDatasetId() !== datasetId) {
						return false;
					}
				} else {
					this.setDatasetId(datasetId);
				}
			}
		}

		return true;
	}

	public getDatasetId(): string {
		return this.datasetId;
	}

	private setDatasetId(id: string) {
		this.datasetId = id;
	}

	private getRequiredColumns(): string [] {
		return this.requiredColumns;
	}

	private setRequiredColumns(col: string) {
		this.requiredColumns.push(col);
	}

}

import {InsightDatasetKind, InsightError, InsightResult, ResultTooLargeError} from "../controller/IInsightFacade";
