					}
				}
			} else if (datasetKind === InsightDatasetKind.Rooms) {
				if (arrOfUuid.has(String(section.getName()))) {
					if (!map.has(String(section.getName()))) {
						map.set(section.getName(), section);
					}
				}
			}
		}
		return Array.from(map.values());
	}

