export default class BuildingEntry {

	public children: RoomEntry[] = [];
	public buildingName: string = "";
	public link: string = "";
	public address: string = "";
	public buildingCode: string = "";
	public valid: boolean = true;

	public setChild(rooms: RoomEntry[]) {
		this.children = rooms;
	}

	public addChild(room: RoomEntry) {
		this.children.push(room);
	}

	public setBuildingName(name: string) {
		this.buildingName = name;
	}

	public setLink(link: string) {
		this.link = link;
	}

	public setAddress(address: string) {
		this.address = address;
	}

	public setBuildingCode(code: string) {
		this.buildingCode = code;
	}

	public setValid(valid: boolean) {
		this.valid = valid;
	}

	public getChildren() {
		return this.children;
	}

	public getBuildingName() {
		return this.buildingName;
	}

	public getLink() {
		return this.link;
	}

	public getAddress() {
		return this.address;
	}

	public getBuildingCode() {
		return this.buildingCode;
	}

	public getValid() {
		return this.valid;
	}


	public async generateRoomInformation(zip: JSZip, unzipped_contents: JSZip): Promise<BuildingEntry> {
		try {
			let file = zip.file(this.getLink().slice(2));
			if (file != null) {
				await this.parseBuildingFile(file);
			}
			let roomPromises: Array<Promise<void>> = [];
			for (const room of this.getChildren()) {
				roomPromises.push(room.setLocation());
			}
			await Promise.all(roomPromises);
		} catch {
			this.setValid(false);
			return Promise.resolve(this);
		}
		return Promise.resolve(this);
	}

	public async parseBuildingFile(file: JSZip.JSZipObject): Promise<void> {
		await file.async("text").then((body: any) => {
			try {
				let html = body;
				const document = parse(body);
				this.findTable(document);
			} catch {
				throw new InsightError("Building file could not be parsed.");
			}
		});


		return Promise.resolve();
	}

	private findTable(document: any): any {
		if (document.childNodes) {
			for (const node of document.childNodes) {
				if (node.nodeName.includes("table")) {
					if (node.attrs){
						for (const attr of node.attrs) {
							if (attr.name && attr.value) {
								if(attr.name.includes("class") && (attr.value.includes("views-table"))) {
									this.parseTable(node);
								}
							}
						}
					}
				}
				this.findTable(node);
			}
		}
	}

	private parseTable(node: any): any {
		if (node.childNodes) {
			for (const tableNode of node.childNodes) {
				if (tableNode.nodeName.includes("tbody")) {
					this.parseTableRows(tableNode);
				}
			}
		}
	}

	private parseTableRows(node: any): any {
		if (node.childNodes) {
			for (const tableNode of node.childNodes) {
				if (tableNode.nodeName.includes("tr")) {
					this.validateTableRow(tableNode);
				}
			}
		}
	}

	private validateTableRow(row: any): any {
		let roomEntry = new RoomEntry();
		for (const node of row.childNodes) {
			if (node.nodeName.includes("td")) {
				if (node.attrs) {
					for (const attr of node.attrs) {
						if (attr.name && attr.value) {
							if (attr.name.includes("class") &&
								(attr.value.includes("views-field-field-room-number"))) {
								let number = this.getRoomNumberFromHTML(node);
								let href = this.getHrefFromHTML(node);
								roomEntry.setNumber(number);
								roomEntry.setHref(href);
							}
							if (attr.name.includes("class") &&
								(attr.value.includes("views-field-field-room-capacity"))) {
								let capacity = this.getCapacityFromHTML(node);
								roomEntry.setSeats(capacity);
							}
							if (attr.name.includes("class") &&
								(attr.value.includes("views-field-field-room-furniture"))) {
								let furniture = this.getFurnitureFromHTML(node);
								roomEntry.setFurniture(furniture);
							}
							if (attr.name.includes("class") &&
								(attr.value.includes("views-field-field-room-type"))) {
								let type = this.getTypeFromHTML(node);
								roomEntry.setType(type);
							}

							roomEntry.setFullname(this.getBuildingName());
							roomEntry.setShortname(this.getBuildingCode());
							roomEntry.setName(roomEntry.getShortname() + "_" + roomEntry.getNumber());
							roomEntry.setAddress(this.getAddress());
						}
					}
				}
			}
		}
		this.addChild(roomEntry);
	}

	private getRoomNumberFromHTML(node: any): string {
		let result = node.childNodes[1].childNodes[0].value;
		result = result.trim();
		return result;
	}

	private getHrefFromHTML(node: any): string {
		let result = node.childNodes[1].attrs[0].value;
		result = result.trim();
		return result;
	}

	private getCapacityFromHTML(node: any): number {
		let result = node.childNodes[0].value;
		result = result.trim();
		return parseInt(result, 10);
	}

	private getFurnitureFromHTML(node: any): string {
		let result = node.childNodes[0].value;
		result = result.trim();
		return result;
	}

	private getTypeFromHTML(node: any): string {
		let result = node.childNodes[0].value;
		result = result.trim();
		return result;
	}

	public validateBuildingEntry() {
		let filtered = this.getChildren().filter(function(room) {
			return room.getValid();
		});
		return filtered.length > 0;
	}

	public JSONToEntry(json: any): BuildingEntry {
		this.setBuildingName(json["buildingName"]);

		let rooms = json["children"];
		let roomEntries = [];
		for (const room of rooms) {
			const roomEntry = new RoomEntry();
			roomEntry.queryObjectFromDisk(room);
			roomEntries.push(roomEntry);
		}

		this.setChild(roomEntries);

		return this;
	}
}

import * as http from "http";
import {InsightError} from "../../../controller/IInsightFacade";
import QueryObject from "../QueryObject";

interface GeoResponse {

	lat?: number;

	lon?: number;

	error?: string;

}
export default class RoomEntry extends QueryObject {

	private location: GeoResponse = {};
	private fullname: string = "";
	private shortname: string = "";
	private number: string = "";
	private name: string = "";
	private address: string = "";
	private lat: number = 0;
	private lon: number = 0;
	private seats: number = 0;
	private type: string = "";
	private furniture: string = "";
	private href: string = "";

	private counter = {
		number: false,
		href: false,
		capacity: false,
		furniture: false,
		location: false,
		type: false
	};

	public getLocation() {
		return this.location;
	}

	public getFullname() {
		return this.fullname;
	}

	public getShortname() {
		return this.shortname;
	}

	public getNumber() {
		return this.number;
	}

	public getName() {
		return this.name;
	}

	public getAddress() {
		return this.address;
	}

	public getLat() {
		return this.lat;
	}

	public getLon() {
		return this.lon;
	}

	public getSeats() {
		return this.seats;
	}

	public getType() {
		return this.type;
	}

	public getFurniture() {
		return this.furniture;
	}

	public getHref() {
		return this.href;
	}

	public getValid() {
		const values = Object.values(this.counter);
		return !values.includes(false);
	}

	public async setLocation(): Promise<void> {
		let encodedURI = encodeURIComponent(this.getAddress());
		let url = "http://cs310.students.cs.ubc.ca:11316/api/v1/project_team216/";
		try {

			const response = await new Promise((resolve, reject) => {
				const req = http.get(url + encodedURI, (res) => {
					let body = "";

					res.on("data", (chunk) => {
						body = body + chunk;
					});

					res.on("end", () => {
						resolve(body);
					});
				});

				req.on("error", (error) => {
					reject(new InsightError("Could not get coordinates. "));
				});

				req.end();
			});

			let parsedBody = JSON.parse(response as string);
			this.location = {
				lat: parsedBody.lat,
				lon: parsedBody.lon
			};
			if (parsedBody.lat && parsedBody.lon) {
				this.setLat(parsedBody.lat);
				this.setLon(parsedBody.lon);
				this.counter.location = true;
			}

			return Promise.resolve();

		} catch {
			return Promise.resolve();
		}
	}

	public setFullname(fullname: string) {
		this.fullname = fullname;
	}

	public setShortname(shortname: string) {
		this.shortname = shortname;
	}

	public setNumber(number: string) {
		this.number = number;
		this.counter.number = true;
	}

	public setName(name: string) {
		this.name = name;
	}

	public setAddress(address: string) {
		this.address = address;
	}

	public setLat(lat: number) {
		this.lat = lat;
	}

	public setLon(lon: number) {
		this.lon = lon;
	}

	public setSeats(seats: number) {
		this.seats = seats;
		this.counter.capacity = true;
	}

	public setType(type: string) {
		this.type = type;
		this.counter.type = true;
	}

	public setFurniture(furniture: string) {
		this.furniture = furniture;
		this.counter.furniture = true;
	}

	public setHref(href: string) {
		this.href = href;
		this.counter.href = true;
	}

	public queryObjectFromDisk(roomObject: any) {
		this.setFullname(roomObject["fullname"]);
		this.setShortname(roomObject["shortname"]);
		this.setNumber(roomObject["number"]);
		this.setName(roomObject["name"]);
		this.setAddress(roomObject["address"]);
		this.setLat(roomObject["lat"]);
		this.setLon(roomObject["lon"]);
		this.setSeats(roomObject["seats"]);
		this.setType(roomObject["type"]);
		this.setFurniture(roomObject["furniture"]);
		this.setHref(roomObject["href"]);
	}
}

import BuildingEntry from "./BuildingEntry";
import JSZip from "jszip";
import {InsightError} from "../../../controller/IInsightFacade";
import {parse} from "parse5";

export default class ParseRoomsHTML {

	public buildings: BuildingEntry[] = [];

	public getBuildings() {
		return this.buildings;
	}

	public setBuildings(buildings: BuildingEntry[]) {
		this.buildings = buildings;
	}

	public addBuilding(building: BuildingEntry) {
		this.buildings.push(building);
	}

	public async parseZip(content: string): Promise<BuildingEntry[]> {
		/*
		Parses zip file using JSZip.

		Turns Zip file into a SectionsDatasetEntry if possible.
		- If not possible, then throws an InsightError.
		- If not valid zip file, throws InsightError
		- If can't find index.htm file, throws InsightError.

		Attempts to validate the index.htm file.
		 */
		let zip = new JSZip();
		let buildings: BuildingEntry[] = [];
		await zip.loadAsync(content, {base64: true}).then(async (unzipped_contents) => {
			try {
				let filenames = Object.keys(unzipped_contents.files);
				let index = await this.findAndParseIndex(zip, unzipped_contents, filenames);
			} catch {
				throw await Promise.reject(new InsightError("Unable to parse dataset entry."));
			}
		});
		return Promise.resolve(this.getBuildings());
	}

	private async findAndParseIndex(zip: JSZip, unzipped_contents: JSZip, filenames: string[]): Promise<string> {
		try {
			let index = "";
			let indexFilenameContained = true;
			for (const filename of filenames) {
				if (filename === "index.htm") {
					indexFilenameContained = true;
				}
			}
			if (indexFilenameContained){
				let file = zip.file("index.htm");
				await this.parseIndex(file, "index.htm");
				let awaitedBuildings = await this.validateBuildings(zip, unzipped_contents);
			}
		} catch {
			return Promise.reject(new InsightError());
		}
		return Promise.resolve("Could not find index.htm");
	}

	private async parseIndex(file: JSZip.JSZipObject | null, filename: string): Promise<void> {
		/*
		Parses index file and returns table.
		 */
		if (file != null) {
			await file.async("text").then((body: any) => {
				try {
					const document = parse(body);
					this.findTable(document);
				} catch {
					return Promise.reject(new InsightError("Could not parse index.htm."));
				}
			});
		}

		return Promise.resolve();
	}

	private async validateBuildings(zip: JSZip, unzipped_contents: JSZip) {
		let filledBuildings: Array<Promise<BuildingEntry>> = [];
		for (const building of this.getBuildings()) {
			let result = building.generateRoomInformation(zip, unzipped_contents);
			filledBuildings.push(result);
		}
		let awaitedBuildings = await Promise.all(filledBuildings);
		this.setBuildings(awaitedBuildings);
		let filteredBuildings = this.getBuildings().filter(function(building) {
			return building.validateBuildingEntry();
		});

		this.setBuildings(filteredBuildings);

		return Promise.resolve(filteredBuildings);
	}

	private findTable(document: any): any {

		if (document.childNodes) {
			for (const node of document.childNodes) {
				if (node.nodeName.includes("table")) {
					if (node.attrs){
						for (const attr of node.attrs) {
							if (attr.name && attr.value) {
								if(attr.name.includes("class") && (attr.value.includes("views-table"))) {
									this.parseTable(node);
								}
							}
						}
					}
				}
				this.findTable(node);
			}
		}
	}

	private parseTable(node: any): any {
		if (node.childNodes) {
			for (const tableNode of node.childNodes) {
				if (tableNode.nodeName.includes("tbody")) {
					this.parseTableRows(tableNode);
				}
			}
		}
	}

	private parseTableRows(node: any): any {
		if (node.childNodes) {
			for (const tableNode of node.childNodes) {
				if (tableNode.nodeName.includes("tr")) {
					this.validateTableRow(tableNode);
				}
			}
		}
	}

	private validateTableRow(row: any): any {
		let buildingEntry = new BuildingEntry();
		for (const node of row.childNodes) {
			if (node.nodeName.includes("td")) {
				if (node.attrs) {
					for (const attr of node.attrs) {
						if (attr.name && attr.value) {
							if (attr.name.includes("class") &&
								(attr.value.includes("views-field-field-building-code"))) {
								let code = this.getBuildingCodeFromHTML(node);
								buildingEntry.setBuildingCode(code);
							}
							if (attr.name.includes("class") && (attr.value.includes("views-field-title"))) {
								let link = this.getBuildingLinkFromHTML(node);
								let name = this.getBuildingNameFromHTML(node);
								buildingEntry.setLink(link);
								buildingEntry.setBuildingName(name);
							}
							if (attr.name.includes("class") &&
								(attr.value.includes("views-field-field-building-address"))) {
								let address = this.getBuildingAddressFromHTML(node);
								buildingEntry.setAddress(address);
							}
						}
					}
				}
			}
		}
		this.addBuilding(buildingEntry);
	}

	private getBuildingCodeFromHTML(node: any): string {
		let text = node.childNodes[0].value;
		text = text.trim();
		return text;
	}

	private getBuildingLinkFromHTML(node: any): string {
		let text = node.childNodes[1].attrs[0].value;
		return text;
	}

	private getBuildingNameFromHTML(node: any): string {
		let text = node.childNodes[1].childNodes[0].value;
		text = text.trim();
		return text;
	}

	private getBuildingAddressFromHTML(node: any): string {
		let text = node.childNodes[0].value;
		text = text.trim();
		return text;
	}
}

